import 'dart:convert';

import 'package:flutter/material.dart';
import 'package:flutter_share_me/flutter_share_me.dart';

class SharePage extends StatefulWidget {
  @override
  _SharePageState createState() => _SharePageState();
}

class _SharePageState extends State<SharePage> {
  String msg = 'hello,this is my github:https://github.com/lizhuoyuan';
  String base64Image =
      "data:image/jpeg;base64,";

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text('Plugin example app'),
      ),
      body: Container(
        width: double.infinity,
        child: Column(
          crossAxisAlignment: CrossAxisAlignment.center,
          children: <Widget>[
            Image.memory(
              base64.decode(base64Image.split(',')[1]),
              height: 312,
              width: 175.3,
              fit: BoxFit.fill,
              gaplessPlayback: true,
            ),
            SizedBox(height: 30),
            RaisedButton(
              child: Text('share to twitter'),
              onPressed: () async {
                var response = await FlutterShareMe().shareToTwitter(
                    url: 'https://github.com/lizhuoyuan', msg: msg);
                if (response == 'success') {
                  print('navigate success');
                }
              },
            ),
            RaisedButton(
              child: Text('share to shareWhatsApp'),
              onPressed: () {
                FlutterShareMe()
                    .shareToWhatsApp(base64ImageUrl: base64Image, msg: msg);
              },
            ),
            RaisedButton(
              child: Text('share to shareFacebook'),
              onPressed: () {
                FlutterShareMe().shareToFacebook(
                    url: 'https://github.com/lizhuoyuan', msg: msg);
              },
            ),
            RaisedButton(
              child: Text('share to System'),
              onPressed: () async {
                var response = await FlutterShareMe().shareToSystem(msg: msg);
                if (response == 'success') {
                  print('navigate success');
                }
              },
            ),
          ],
        ),
      ),
    );
  }
}
